    by Linda Chavez.  A deposit was paid toward the purchase of the mailing list(See
    Schedule B, Line 21(b)).  At the time the agreement was entered into, an estimate
    of the list's value was made by an indepdent mail list broker.  This estimate
    was $8,000.00.   A more complete valuation will be made of the list at the time
    the final payment is made.  The Committee is disclosing the amount due based on
    the initial estimate of the value of the list.  This will be adjusted when the
    final valuation is made.  The final valuation of the list was made  by RMLC on
    8/3/09.  The value of the list has declined significantly from the time of the
